#Exclusive | "It is important to hold government accountable for the fact that activists, students and young people were detained":  Dia Mirza (@deespeak), Actor and  U.N Environment Goodwill Ambassador on 
@LRC_NDTV

#Aarey https://t.co/9yKzev2UcV

"These numbers aren't anyone's opinions or political views"

@GretaThunberg says "richer countries need to do their fair share" and "help poorer countries do the same", to tackle climate change at the COP25 climate summit in Madrid

Read more: https://t.co/xId8XkR1Nc https://t.co/4qmYgfjHtX

"You come to us young people for hope - how dare you?"

@GretaThunberg speaks passionately about the need to tackle climate change at a UN summit in New York, telling world leaders "if you choose to fail us‚Ä¶ we will never forgive you"

[tap to expand] https://t.co/XSkh1uuqlm https://t.co/Mt2cun1jBU

Environmental activist #GretaThunberg nominated for Nobel Peace Prize

@NobelPrize

https://t.co/CpZd6LSYhH

'We have leaders right now that are leading us off a cliff. The climate crisis is here.'

@ashnahurynag reports from #ExtinctionRebellion protests in London and speaks to the group's co-founder @gailbradbrook, who calls for the end of the "fossil fuel era"
https://t.co/7E33CbOu9W https://t.co/3Siy3UuVkZ

"We need more than words."

@Luisamneubauer, known as the 'German Greta', says her country's government needs to take "drastic measures" now on climate change and it "must include a rapid coal phase out". 

#DailyClimateShow: https://t.co/XPiUpQgFuT https://t.co/jlxYbHNxMN

