"They want to make their voices heard - and you can hear that's exactly what they are doing!"

@BeckyJohnsonSky is in Cardiff Bay where chanting children are on strike from school over climate change. 

Latest on #schoolstrike4climate here: https://t.co/A9tliSzj1i https://t.co/gLyObQAMKr

Children in Cardiff are among tens of thousands striking for action on climate change today.

@BeckyJohnsonSky speaks to some of the pupils making their voices heard.

